import Navbar from "./../../components/navbar/Navbar";
import Breadcrumb from "../../components/breadcrumb/Breadcrumb";
import Footer from "../../components/footer/Footer";
import Services from './../../components/services/Services';
import Sdata from './../../components/services/Sdata';
import './find-service.css'
const FindService = () =>{

    function getOption() {
        var selectElement = document.querySelector('#select1');
        var output = selectElement.value;
        
    }

    return (
        <>
       <Navbar />
       <Breadcrumb title="Find a Service" />
       <h2 className='Find-Service-Header'>Select Service You Need</h2>
       <label for="cars">Choose an Area: </label>

        <select name="address" id="cars">
        <option value="Scheme 3">Scheme 3</option>
        <option value="Bahria Town">Bahria Town</option>
        <option value="PWD">PWD</option>
        </select>
        

        
       {Sdata.map((val) => {
        return (
            <Services 
                imgsrc={val.imgscr} 
                sname={val.sname} 
                link={val.link}
                
            />
            
        );
    })}

       <Footer />
        </>
    );
}

export default FindService;
